import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/optimizacion.css';

class SeccionDato extends React.Component{
    render(){
        return(
            <div className="form-group row">
                <div className="col-9 text-center">
                    <select className="custom-select" id="inputGroupSelect01">
                        <option selected>Elegir {this.props.nombre}</option>
                        {this.props.sabores.map(dato => (<option id={dato.id}>{dato.nombre}</option>))}
                        <option value="1">Dulce de leche</option>
                    </select>
                </div>
                <div className="col-3 text-center">
                    <div className="input-group">
                        <input type="number" className="form-control" aria-label="Demanda en kg"></input>
                        <div className="input-group-append">
                            <span className="input-group-text">kg</span>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default SeccionDato;
